import axios from 'axios';
import React, { useState } from 'react'
import { Helmet } from 'react-helmet'
import { useForm } from 'react-hook-form';

export const AdminDashBoard2 = () => {
    const { register, handleSubmit } = useForm();

    const [users, setusers] = useState()

    const submit = (data) => {

        console.log(data)
        axios.post("http://localhost:5000/project/project", data).then((res) => {
            console.log(res)
            getApi()
        }).catch((err) => {
            console.log(err)
        })


    };

    const getApi = () => {

        axios.get("http://localhost:5000/project/project").then((res) => {

            console.log(res.data.project)
            setusers(res.data.project)

        }).catch((err) => {

            console.log(err)
        })


    }

 window.addEventListener("reload", () => {
    getApi()
  })

    const updateProject = (id) => {
        axios.put("http://localhost:5000/project/project/" + id).then((res) => {
            getApi()
        }).catch((err) => {
            console.log(err);
        })
    }
    const deleteProject = (id) => {

        axios.delete("http://localhost:5000/project/project/" + id).then((res) => {


            getApi()



        }).catch((err) => {

            console.log(err)
        })
    }
    return (
        <div class=''>
            <Helmet>
                <link href='https://unpkg.com/boxicons@2.0.9/css/boxicons.min.css' rel='stylesheet' />
                <link rel="stylesheet" href="https://unicons.iconscout.com/release/v4.0.0/css/line.css" />
                <link rel="stylesheet" href="../assets/vendor/fonts/jaymin.css" />
            </Helmet>
            <section class="back">
                <div class='background' onLoad={getApi()}>
                <form onSubmit={handleSubmit(submit)}>
                    <div>
                        <label>title</label>
                        <input type="text" {...register("title")} />
                    </div>
                    <div>
                        <label>description</label>
                        <input type="text" {...register("description")} />
                    </div>
                    <div>
                        <label>technology</label>
                        <input type="text" {...register("technology")} />
                    </div>
                    <div>
                        <label>estimatedHours</label>
                        <input type="number" {...register("estimatedHours")} />
                    </div>
                    {/* <div>
                        <label>createdAt_Date</label>
                        <input type="date" {...register("createdAt_Date")} />
                    </div>
                    <div>
                        <label>updatedAt_Date</label>
                        <input type="date" {...register("updatedAt_Date")} />
                    </div> */}
                    <div>
                        <input type="submit" value="submit" />
                    </div>
                </form>
                {/* <button onClick={getApi}>Get Api</button> */}
                </div>

                <div class="data">
                    <div class="content-data">
                        <div class="head">
                            <h3>Project List</h3>
                            <form action="#">
                                <div class="form-group">
                                    <input type="text" placeholder="Search..." />
                                    <i class='bx bx-search icon' ></i>
                                </div>
                            </form>
                            <div class="refresh">
                                <i class="uil uil-redo"></i>
                            </div>
                            <div class="menu">
                                <i class='bx bx-dots-horizontal-rounded icon'></i>
                                <ul class="menu-link">
                                    <li><a href="#">Medium</a></li>
                                    <li><a href="#">Subject Code</a></li>
                                    <li><a href="#">Type</a></li>
                                </ul>
                            </div>
                        </div>

                        <table class="ann" >
                            <tr>
                                <th>Id</th>
                                <th>title</th>
                                <th>description</th>
                                <th>technology</th>
                                <th>estimatedHours</th>
                                {/* <th>createdAt_Date</th>
                                <th>updatedAt_Date</th> */}
                            </tr>
                            {
                                users?.map((u) => {
                                    return (<tr>
                                        <td>{u._id}</td>
                                        <td>{u.title}</td>
                                        <td>{u.description}</td>
                                        <td>{u.technology}</td>
                                        <td>{u.estimatedHours}</td>
                                        {/* <td>{u.createdAt_Date}</td>
                                        <td>{u.updatedAt_Date}</td> */}

                                        <td>
                                            <button onClick={() => { updateProject(u._id) }}><i class="uil uil-edit"></i></button>
                                            <button onClick={() => { deleteProject(u._id) }}><i class="uil uil-trash-alt"></i></button>
                                        </td>
                                    </tr>)
                                })
                            }

                        </table>
                    </div>
                </div>
            </section>
            

        </div>
        // </div >


    )
}
